    this.state = {
     monsters: [
       {
         name : 'Satish'
       },
       {
        name : 'Sonu'
      },
      {
        name : 'Shreyansh'
      },
      {
        name : 'Ashok'
      },
      {
        name : 'Vani'
      }
     ]
    }
  }
  render(){



    return (

          <div className="App">
            {this.state.monsters.map(monster => <h1>monster.name</h1>)}
          </div>
        );
      }

}

